import React from "react";
import { Container } from "react-bootstrap";
import "./Culture.css";

function Culture() {
  return (
    <Container className="culture_contain">
      <div className="culture_grid">
        <div className="culture_1  culture_text"> Culture is our heritage.</div>
        <div className="culture_2">
          <div className="culture_title">
            Nigerian Cultural Activities around the world
          </div>
          <div className="culture_article">
            <div className="article_side1">ff</div>
            <div className="article_side2">fff</div>
            <div className="article_side3">ff</div>
            <div className="article_side4">fff</div>
            <div className="article_side5">ff</div>
            <div className="article_side6">fff</div>
          </div>
        </div>
      </div>
    </Container>
  );
}

export default Culture;
